import React from 'react';
import './SearchImagePage.scss';
import SearchImage from '../../Components/SearchImage/SearchImage';
import {connect} from 'react-redux';
import {selectSearchImageById} from '../../Redux/Search/search-selectors';

const SearchImagePage = ({searchImageById}) => {
    return (
        <div className="searchimagepage">
        {
            searchImageById.length 
            ? ( <div>
                <img src={searchImageById.links[0].href} alt="searchimage"/>
                <span>{searchImageById.data[0].title}</span>
                <span>{searchImageById.data[0].description}</span>
                </div>
            ) 
            : null

        }

        </div>
    )
}

const mapStateToProps = (state, ownProps) => ({
    searchImageById: selectSearchImageById(ownProps.match.params.searchId)(state)
})

export default connect(mapStateToProps)(SearchImagePage);
